document.addEventListener('DOMContentLoaded', (event) => {
  
    function chekBox(){
        let checkblock = document.getElementById('btn-block');
    
    if(checkblock.checked) {
        console.log("O cliente marcou o checkbox");
    } else {
        console.log("O cliente não marcou o checkbox");
    }
    }

});
